(function (Scratch) {
  if (!Scratch.extensions.unsandboxed) {
    window.alert('The extension "Potato Extension" must be ran unsandboxed!');
    throw new Error('The extension "Potato Extension" must be ran unsandboxed!');
  }

  let potatoImage = `data:image/png;base64,`;

  let potatoStyles = document.createElement("style");
  potatoStyles.innerHTML = `
    @keyframes squashPotato {
      0% {
        transform: scaleY(1);
      }
      50% {
        transform: scaleY(0.1);
      }
      100% {
        transform: scaleY(0.1);
        opacity: 0;
      }
    }
      
    .potato {
      width: 150px;
      height: 100px;
      z-index: 1234567890;
      transform-origin: bottom;
      pointer-events: none;
    }`;
  document.head.appendChild(potatoStyles);

  class ddePotatoExtension {
    getInfo() {
      return {
        id: "ddePotatoExtension",
        name: "Potato Extension",
        color1: '#947948',
        blocks: [
          {
            opcode: "generatePotato",
            blockType: Scratch.BlockType.COMMAND,
            text: "Generate potato",
          },
          {
            opcode: "mashAllPotatoes",
            blockType: Scratch.BlockType.COMMAND,
            text: "Mash all potatoes",
          },
          {
            opcode: "potatoCounter",
            blockType: Scratch.BlockType.REPORTER,
            text: "Number of potatoes",
          },
        ],
      };
    }

    generatePotato() {
      const potato = document.createElement("img");
      potato.src = potatoImage;
      potato.style.position = "absolute";
      potato.style.left = `${Math.random() * (window.innerWidth - 150)}px`;
      potato.style.top = `${Math.random() * (window.innerHeight - 100)}px`;
      potato.classList.add("potato");
      document.body.appendChild(potato);
    }

    mashAllPotatoes() {
      const potatoes = document.querySelectorAll("img.potato");
      potatoes.forEach((potato) => {
        if (potato.style) {
          potato.style.animation = "squashPotato 1s ease";
          setTimeout(() => potato.remove(), 1000);
        }
      });
    }

    potatoCounter() {
      return document.querySelectorAll("img.potato").length;
    }
  }

  Scratch.extensions.register(new ddePotatoExtension());
})(Scratch);
